@geokaramanis @R4DScommunity Lubridate uses the year 0000, which did not exist. Hence the +1: if you want to calculate the age of someone born in 62 BCE and dead in 14 AD, that is the 62 years until 1AD, then 13 years until 14AD.
Or: 14-(-62)+1.
Your R is much more elegant than mine though üòÖ #TidyTuesday

